import {FETCH_GNOMES} from '../actions/types'

// const initialState = {
//     items : [],
//     item:{}
// } 

export default function(state=initialState, action){
    switch(action.type){
        case FETCH_GNOMES:
            return action.payload;
            break;

    }
    return state;
}
